    false,nt"url": null,nt"notes": "This narrative report for Pea Island NWR
    outlines Refuge accomplishments from September through December of 1958. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, furbearers, rodents, raptors, fish, and disease- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    collections and receipts, and vegetation control. Resource management is outlined;
    topics include commercial fishing. The public relations section of the report describes
    recreational uses, Refuge visitors, and violations. N-R forms and photographs are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
